def is_woodall(x):
    """
    Check if the given number is woodball or not.
    A number is woodball if it is a positive integer and the number of digits in its binary representation is a prime number.
    For example:
    is_woodall(3) == True
    is_woodall(4) == False
    """
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    binary = bin(x)[2:]
    num_digits = len(binary)
    return is_prime(num_digits)
