def compute_Last_Digit(A,B):
    """Given two positive integers A and B, find the largest integer K such that A divides factorial of B and K is less than B.
    For example:
    compute_Last_Digit(2,5) == 2
    compute_Last_Digit(3,7) == 3
    compute_Last_Digit(4,10) == 4
    """
    def factorial(n):
        if n == 0:
            return 1
        else:
            return n * factorial(n-1)

    fact_B = factorial(B)

    if fact_B == 0:
        return 0

    last_digit_A = A % 10

    if last_digit_A == 0:
        return 10

    k = 0
    while fact_B % last_digit_A != 0:
        k += 1
        if k > B:
            return 0
    return last_digit_A
