def smartNumber(n):
    """
    A smart number is a number such that the sum of the factorial of its digits is equal to the number itself.
    For example, 145 is a smart number because 1! + 4! + 5! = 1 + 24 + 120 = 145.
    Given an integer n, find the n'th smart number.
    For example:
    smartNumber(1) == 145
    smartNumber(2) == 2187
    smartNumber(3) == 3283
    """
    def factorial(n):
        if n == 0:
            return 1
        else:
            return n * factorial(n-1)

    def isSmart(num):
        sum_factorial = 0
        for digit in str(num):
            sum_factorial += factorial(int(digit))
        return sum_factorial == num

    count = 0
    num = 1
    while count < n:
        if isSmart(num):
            count += 1
        num += 1
    return num - 1
```

