def is_Sum_Of_Powers_Of_Two(n):
    """
    Given a non-negative integer n, return True if n can be represented as sum of non-zero powers of 2,
    otherwise return False.
    For example:
    is_Sum_Of_Powers_Of_Two(1) == True
    is_Sum_Of_Powers_Of_Two(5) == True
    is_Sum_Of_Powers_Of_Two(6) == False
    """
    if n <= 0:
        return False
    while n > 0:
        if n % 2 == 0:
            n //= 2
        else:
            if n == 1:
                return True
            else:
                return False
    return True
```

