    """
    Given two integers x and y, check whether the given number is co-prime or not.
    Two numbers are said to be co-prime if they have no common factors other than 1.
    """
    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    if gcd(x, y) == 1:
        return True
    else:
        return False
