def is_valid_parenthese( str1):
    """Given a string s consisting of parentheses only, return true if the string is valid, false otherwise.
    For example:
    is_valid_parenthese("()") == True
    is_valid_parenthese("()[]{}") == True
    is_valid_parenthese("(]") == False
    """
    stack = []
    mapping = {")": "(", "]": "[", "}": "{"}
    for char in str1:
        if char in mapping:
            top_element = stack.pop() if stack else '#'
            if mapping[char] != top_element:
                return False
        else:
            stack.append(char)
    return not stack
