def binary_search(arr, low, high, x):
    """
    Given a sorted array, find the first and last occurrence of a given element.
    If the element is not present, return -1.
    """
    first_occurrence = -1
    last_occurrence = -1

    while low <= high:
        mid = (low + high) // 2

        if arr[mid] == x:
            first_occurrence = mid
            high = mid - 1  # Continue searching on the left side for the first occurrence
        elif arr[mid] < x:
            low = mid + 1
        else:
            high = mid - 1

    low = 0
    high = len(arr) - 1

    while low <= high:
        mid = (low + high) // 2

        if arr[mid] == x:
            last_occurrence = mid
            low = mid + 1  # Continue searching on the right side for the last occurrence
        elif arr[mid] < x:
            low = mid + 1
        else:
            high = mid - 1

    if first_occurrence != -1 and last_occurrence != -1 and last_occurrence - first_occurrence + 1 > len(arr) // 2:
        return True
    else:
        return False
