    if high == low:
        return arr[low]

    mid = (low + high) // 2

    if arr[mid] > arr[high]:
        return arr[high]

    if arr[mid] < arr[low]:
        return arr[mid]

    if arr[mid] < arr[high]:
        return find_Min(arr, low, mid - 1)
    else:
        return find_Min(arr, mid + 1, high)
