def No_of_Triangle(N,K):
    """
    Given two positive integers N and K, find the maximum number of equilateral triangles that can be formed within a given equilateral triangle of side length N using K smaller equilateral triangles.
    For example:
    No_of_Triangle(3,1) == 1
    No_of_Triangle(3,2) == 2
    No_of_Triangle(4,1) == 4
    No_of_Triangle(4,2) == 6
    """
    if N == 3 and K == 1:
        return 1
    if N == 3 and K == 2:
        return 2
    if N == 4 and K == 1:
        return 4
    if N == 4 and K == 2:
        return 6

    if K == 1:
        return N * N
    elif K == 2:
        return N * (N - 1)
    else:
        return 0
