    get_total_number_of_sequences(5,2) == 2
    get_total_number_of_sequences(5,3) == 1
    get_total_number_of_sequences(10,3) == 23
    """
    if n == 1:
        return 1
    dp = [[0 for _ in range(m + 1)] for _ in range(n + 1)]
    for i in range(1, n + 1):
        for j in range(1, m + 1):
            dp[i][j] = dp[i - 1][j]
            if i > 1:
                dp[i][j] += dp[i - 1][max(0, j - 2)]
            else:
                dp[i][j] += 1
    return dp[n][m]
