    Given an array, find the maximum sum of bi-tonic sub-sequence for the given array.
    For example:
    max_sum([9, 6, 3, 8, 1, 5], 6) == 22
    max_sum([1, 15, 7, 2, 4, 8], 6) == 33
    max_sum([1, 2, 3, 4, 5, 6], 6) == 12
    """
    inc = [0] * n
    dec = [0] * n
    for i in range(n):
        inc[i] = arr[i]
        for j in range(i):
            if arr[i] > arr[j]:
                inc[i] = max(inc[i], inc[j] + arr[i])
    for i in range(n - 1, -1, -1):
        dec[i] = arr[i]
        for j in range(n - 1, i, -1):
            if arr[i] > arr[j]:
                dec[i] = max(dec[i], dec[j] + arr[i])
    max_sum = 0
    for i in range(n):
        max_sum = max(max_sum, inc[i] + dec[i] - arr[i])
    return max_sum
