def get_Position(a,n,m):
    """
    Given a sorted array a of n elements, an integer m, and an integer q,
    find the position of the last removed element from the given array.
    The main function is defined by the function signature: def get_Position(a,n,m)
    """
    if m > n:
        return -1
    low = 0
    high = n - 1
    while low <= high:
        mid = (low + high) // 2
        if a[mid] == m:
            low = mid + 1
        elif a[mid] < m:
            low = mid + 1
        else:
            high = mid - 1
    if low == n:
        return -1
    else:
        return low
```

