def max_sum_rectangular_grid(grid, n):
    """
    You are given a 2 x n grid of integers. You can choose either the first or the second row.
    You must choose a subset of the numbers in the grid such that no two chosen numbers
    are adjacent. Find the maximum sum such that no two chosen numbers are adjacent.
    For example:
    max_sum_rectangular_grid([[1, 2, 3, 4], [5, 6, 7, 8]], 4) == 19
    max_sum_rectangular_grid([[1, 2, 3, 4], [5, 6, 7, 8]], 2) == 10
    max_sum_rectangular_grid([[1, 2, 3, 4], [5, 6, 7, 8]], 3) == 19
    """
    if n == 0:
        return 0
    elif n == 1:
        return max(grid[0])
    elif n == 2:
        return max(grid[0][0] + grid[1][1], grid[0][1] + grid[1][0])
    else:
        dp = [0] * n
        dp[0] = max(grid[0][0], grid[1][0])
        dp[1] = max(grid[0][1], grid[1][1])
        for i in range(2, n):
            dp[i] = max(dp[i - 1], dp[i - 2] + grid[0][i], dp[i - 2] + grid[1][i])
        return dp[n - 1]
```

