def max_cuboid_volume(sum_of_sides):
    """
    Given a sum of sides of a cuboid, find the maximum volume of the cuboid.
    For example:
    max_cuboid_volume(12) == 8
    max_cuboid_volume(100) == 16807
    """
    if sum_of_sides <= 0:
        return 0
    max_volume = 0
    for x in range(1, sum_of_sides // 2 + 1):
        for y in range(1, (sum_of_sides - 2 * x) // 2 + 1):
            z = sum_of_sides - 2 * x - 2 * y
            if z > 0:
                volume = x * y * z
                if volume > max_volume:
                    max_volume = volume
    return max_volume
```

