def find_Divisor(x, y):
    """
    Given an interval [x, y], find the maximum occurring divisor in the interval.
    For example:
    find_Divisor(1, 10) == 2
    find_Divisor(1, 5) == 1
    """
    if x == y:
        return x

    count = {}
    for i in range(x, y + 1):
        for j in range(1, int(i**0.5) + 1):
            if i % j == 0:
                if j in count:
                    count[j] += 1
                else:
                    count[j] = 1
                if j * j != i and i // j in count:
                    count[i // j] += 1
                else:
                    count[i // j] = 1

    max_divisor = 1
    max_count = 0
    for divisor, freq in count.items():
        if freq > max_count:
            max_count = freq
            max_divisor = divisor
        elif freq == max_count and divisor > max_divisor:
            max_divisor = divisor

    return max_divisor
```

