def zigzag(n, k):
    """
    Given two positive integers n and k, find the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to reach from 1 to n by making n steps
    where in each step you can move either k steps up or k steps down.
    For example:
    zigzag(3, 2) == 5
    zigzag(4, 2) == 11
    zigzag(5, 2) == 16
    """
    dp = {}

    def solve(i, up):
        if i == n:
            return 1
        if i > n:
            return 0
        if (i, up) in dp:
            return dp[(i, up)]

        ans = 0
        if up:
            ans += solve(i + k, False)
        else:
            ans += solve(i - k, True)

        dp[(i, up)] = ans
        return ans

    return solve(1, True) + solve(1, False)
```

