def get_carol(n):
    """
    Finds the n'th carol number.
    Carol numbers are numbers that can be expressed as a sum of consecutive positive integers.
    For example, 6 = 1 + 2 + 3, 10 = 1 + 2 + 3 + 4, 12 = 1 + 2 + 3 + 4 + 5.
    """
    if n <= 0:
        return 0

    carol_numbers = set()
    for i in range(1, int((2 * n)**0.5) + 2):
        for j in range(1, int((2 * n)**0.5) + 2):
            sum_val = i + j
            k = int((sum_val - i) / 2)
            if (sum_val - i) % 2 == 0 and k > 0:
                carol_numbers.add(sum_val)

    carol_numbers.remove(0)
    carol_numbers = sorted(list(carol_numbers))
    if n <= len(carol_numbers):
        return carol_numbers[n - 1]
    else:
        return -1
```

