def get_carol(n):
    """
    Finds the n'th carol number.
    Carol numbers are defined as numbers that can be expressed as the sum of two or more consecutive positive integers.
    For example, 6 = 1 + 2 + 3, 12 = 1 + 2 + 3 + 4 + 5, etc.
    """
    if n <= 0:
        return 0

    if n == 1:
        return 1

    carol_numbers = set()
    for i in range(1, n + 1):
        for j in range(i, n + 1):
            sum_numbers = 0
            for k in range(i, j + 1):
                sum_numbers += k
            if sum_numbers in carol_numbers:
                continue
            carol_numbers.add(sum_numbers)

    return sorted(list(carol_numbers))[n - 1]
