def max_Product(arr):
    """
    Given an array of integers, find a pair with the highest product.
    For example:
    max_Product([1, 2, 3, 4, 5]) == (4, 5)
    max_Product([-1, -2, -3, -4, -5]) == (-1, -2)
    max_Product([-1, 0, 1, 2, 3]) == (2, 3)
    """
    if len(arr) < 2:
        return None

    arr.sort()
    product1 = arr[0] * arr[1]
    product2 = arr[-1] * arr[-2]

    if product1 > product2:
        return (arr[0], arr[1])
    else:
        return (arr[-2], arr[-1])
```

