def get_maxgold(gold, m, n):
    """
    Given a 2D grid of integers where 1 represents gold and 0 represents empty,
    find the maximum gold you can collect by moving up, down, left, or right.
    You can only move to a cell with gold if it is adjacent to the current cell.

    Args:
        gold (list[list[int]]): The 2D grid of integers.
        m (int): The number of rows in the grid.
        n (int): The number of columns in the grid.

    Returns:
        int: The maximum gold you can collect.
    """
    if not gold or m == 0 or n == 0:
        return 0

    dp = [[0] * n for _ in range(m)]

    for i in range(m):
        for j in range(n):
            if gold[i][j] == 1:
                if i == 0 or i == m - 1 or j == 0 or j == n - 1:
                    dp[i][j] = 1
                else:
                    dp[i][j] = min(dp[i - 1][j], dp[i + 1][j], dp[i][j - 1], dp[i][j + 1]) + 1

    max_gold = 0
    for i in range(m):
        for j in range(n):
            max_gold = max(max_gold, dp[i][j])

    return max_gold
```

