def count_Occurrence(tup, lst):
    """
    Given a tuple and a list, count the occurence of all elements of list in tuple.
    For example:
    count_Occurrence((1, 2, 3, 1), [1, 2]) == {'1': 2, '2': 1, '3': 1}
    count_Occurrence((1, 2, 3), [4, 5, 6]) == {'4': 0, '5': 0, '6': 0}
    """
    res = {}
    for item in lst:
        res[str(item)] = tup.count(item)
    return res
