def check_Triangle(x1,y1,x2,y2,x3,y3):
    """Given three points, check whether the triangle is valid or not
    For a triangle to be valid, the sum of the squares of any two sides
    must be greater than the square of the third side.
    """
    def distance(x1, y1, x2, y2):
        return ((x1 - x2) ** 2 + (y1 - y2) ** 2)

    a = distance(x1, y1, x2, y2)
    b = distance(x2, y2, x3, y3)
    c = distance(x3, y3, x1, y1)

    if a + b > c and a + c > b and b + c > a:
        return True
    else:
        return False
