def first_Factorial_Divisible_Number(x):
    """
    Finds the first natural number whose factorial is divisible by x.
    For example:
    first_Factorial_Divisible_Number(6) == 3
    first_Factorial_Divisible_Number(7) == 7
    """
    def factorial(n):
        if n == 0:
            return 1
        else:
            return n * factorial(n-1)

    n = 1
    while True:
        fact = factorial(n)
        if fact % x == 0:
            return n
        n += 1
```

