def average_Odd(n):
    """Given an integer n, find the average of odd numbers till n.
    For example:
    average_Odd(10) == 5
    average_Odd(11) == 6
    average_Odd(17) == 9
    """
    odd_numbers = []
    for i in range(1, n + 1):
        if i % 2 != 0:
            odd_numbers.append(i)
    if len(odd_numbers) == 0:
        return 0
    return sum(odd_numbers) // len(odd_numbers)
```
